import "./styles.scss";
import React, { useState } from "react";
import Card from "./Card";

const Cards = ({ cardsMock }) => {
  const renderCardRows = (cardRows) => {
    return cardRows.map((card) => {
      <Card {...card}></Card>;
    });
  };

  const renderAddCardButton = () => {};

  return cardsMock.map(({ cardsState, cardRows }) => {
    <div className="cards">
      <div className="cards-state">{cardsState}</div>
      {renderCardRows(cardRows)}
      {renderAddCardButton()}
    </div>;
  });
};

export default Cards;
